import React from 'react';

function Search() {
  return (
    <div>
      <form action='' className='form'>
        <input type='text' name='text' placeholder='Search...' />
        <input
          type='submit'
          className='submit'
          value='Search'
          className='btn btn-dark btn-block'
        />
      </form>
    </div>
  );
}

export default Search;
